css:
@font-face {
  font-family: 'Linter-UI-Plus';
  src: url('atom://linter-ui-plus/fonts/linter-ui-plus.woff') format('woff');
  font-weight: normal;
  font-style: normal;
}
.luip-icon::before {
  font-family: 'Linter-UI-Plus';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  text-rendering: optimizeLegibility;
}
.luip-icon-error::before {
  content: "\f026";
  color: #ff6347;
}
.luip-icon-warning::before {
  content: "\f02d";
  color: #e2c08d;
}
.luip-icon-info::before {
  content: "\f059";
  color: #6494ed;
}
